import React, { Component } from "react";
import { connect } from "react-redux";

class ProductList extends Component {
  render() {
    const { products } = this.props;
    const ul = (
      <ul>
        products.map(ele =>
        <li key={ele.id}>ele.proName</li>
        );
      </ul>
    );
    return <div>{ul}</div>;
  }
}

export default ProductList;
